import React from 'react';
import { connect } from 'react-redux';
import './custom-button.styles.scss';

const checkIn = ({ state }) => {
    console.log(`Checking In:  ${typeof state}`)
};

const checkOut = () => {
    console.log("Checking Out")
};

const submitting = () => {
    console.log("submitting")
};

const CustomButton = ({children, isCheckIn, isCheckOut, state, ...props}) => {
    return (
        <div>
            <button
                className={`${isCheckIn ? 'check-in' : isCheckOut ? 'check-out' : 'submit' }  custom-button`}
                onClick={isCheckIn ? () => console.log(state) : isCheckOut ? checkOut : submitting} 
            >
                {children}
            </button>
        </div>
    )
}

const mapStateToProps = (state) => ({
    state: state
});

export default connect(mapStateToProps)(CustomButton);
